class TubiCategory {
  String id;
  String type;
  String title;
  String description;
  String thumbnail;
  dynamic cursor;
  String slug;
  String logo;
  String background;
  List<dynamic> tags;
  List<TuBiTV> children;

  static TubiCategory fromMap(Map<String, dynamic> map) {
    if (map == null) return null;
    TubiCategory dataBean = TubiCategory();
    dataBean.id = map['id'];
    dataBean.type = map['type'];
    dataBean.title = map['title'];
    dataBean.description = map['description'];
    dataBean.thumbnail = map['thumbnail'];
    dataBean.cursor = map['cursor'];
    dataBean.slug = map['slug'];
    dataBean.logo = map['logo'];
    dataBean.background = map['background'];
    dataBean.tags = map['tags'];
    dataBean.children = List()
      ..addAll((map['children'] as List ?? []).map((o) => TuBiTV.fromMap(o)));
    return dataBean;
  }

  Map toJson() => {
        "id": id,
        "type": type,
        "title": title,
        "description": description,
        "thumbnail": thumbnail,
        "cursor": cursor,
        "slug": slug,
        "logo": logo,
        "background": background,
        "tags": tags,
        "children": children,
      };
}

